import Head from './Head';
import Home from './Home';
import SlideShow from './photos';
import Text from './Text';
import Texttow from './Texttow';

function App() {
  return (<>
<div class=" bg-gradient-to-r from-slate-950 from-10% via-slate-820 via-30% to-zinc-600 to-90% ... h-vh">



<Head/>

<div className=' flex h-1/2 justify-center'>
 <div className='w-96 pl-6 pt-3 '><Text/></div>

<div className='w-96 pl-6 mt-16 '><Texttow/></div>
</div>

<SlideShow/>

</div>

</>
  );
}

export default App;
